import './styles.css'

function Contactus()
{

    return(

        <div className='Aboutus'>
<p className='Paragraph'>
mon projet est un site ou on a une page d'accueil, on peut voir tout les films disponibles et en cliquant sur un film on se retrouvera sur sa page. On pourra le noté, voir sa description, son affiche et regarder sa bande-annonce, on aura aussi toutes les plateformes où ce film est disponible, en cliquant dessus, on se retrouvera sur le site de streaming en question.
</p>
<p className='Paragraph2'>
Pour nous contacter, appellez le 51723531 ou envoyer nous un mail sur notre adresse mail: khalilou.benzina@gmail.com</p>




        </div>
    )
}
export default Contactus
